import React from 'react'

const UserInterface = () => {
  return (
    <>
    <form className="shadow-2xl ml-4">
        <input type="text" placeholder='User' className="p-4 border-black roun" />
        <button type="submit" className="btn hover:bg-[#8f989c6e] w-full"> Зайти</button>
    </form>
    </>
  )
}

export default UserInterface
